function getCalcReady() {
	var tempitems = [];
	for(var i = 0; i < items[language].length; i++) {
		tempitems.push(items[language][i]);
		tempitems[i].prevIndex = i;
	}
	return tempitems;
}

function getLevenshtienDistance(a,b) {
	var matrix = [];
	for(var i = 0; i < a.length + 1; i++) {
		matrix.push([]);
		for(var j = 0; j < b.length + 1; j++) {
			if(i === 0 && j === 0) {
				matrix[i].push(0);
			} else if(i === 0) {
				matrix[i].push(matrix[i][j - 1] + 1);
			} else if(j === 0) {
				matrix[i].push(matrix[i - 1][j] + 1);
			} else {
				if(a.charAt(i - 1) === b.charAt(j - 1)) {
					matrix[i].push(matrix[i - 1][j - 1]);
				} else {
					matrix[i].push(Math.min(matrix[i - 1][j], matrix[i][j - 1], matrix[i - 1][j - 1]) + 1);
				}
			}
		}
	}
	return matrix[a.length][b.length] + getExtraOffset(a,b);
}

function calc() {
	$("#go").html("Zoeken...");
	var hasQuotes = /"([^']+)"/.test(document.getElementById("in").value);
	var compare = removeJunk(document.getElementById("in").value.toLowerCase());
	var tempitems = getCalcReady();
	for(var i = 0; i < tempitems.length; i++) {
		tempitems[i].distance = getLevenshtienDistance(removeJunk(tempitems[i].word), compare);
	}
	tempitems = tempitems.sort(function(a,b){
		return a.distance - b.distance;
	});
	$(".answers").remove();
	for(var i = 0; i < tempitems.length; i++) {
		if(!hasQuotes || removeJunk(tempitems[i].word).indexOf(/"([^']+)"/.exec(document.getElementById("in").value.normalize('NFD').replace(/[\u0300-\u036f]/g, ""))[1]) !== -1)$("body").append("<div class=\"answers row\"><p class=\"col-sm-2\">" + Math.round(tempitems[i].distance * 10) / 10 + "</p><p class=\"col-sm-5\">"+ items[language][tempitems[i].prevIndex].word + "</p><p class=\"col-sm-5\">" + items[language][tempitems[i].prevIndex].meaning + "</p></div>");
	}
	$("#go").html("Zoeken");
}

function getExtraOffset(a,b) {
	var offset = 1 / (Math.min(a.length, b.length) - 1);
	var out = 0;
	for(var i = 0; i < Math.min(a.length, b.length); i++) {
		if(a.charAt(i) === b.charAt(i)) {
			out -= 1 - offset * i;
		} else {
			out += 1 - offset * i;
		}
	}
	return out;
}

function removeJunk(s) {
	var out = s;
	out = out.replace(/^\u1f41\u0020/g,"");
	out = out.replace(/^\u1f21\u0020/g,"");
	out = out.replace(/^\u03c4\u1f79\u0020/g,"");
	out = out.replace(/ *\([^)]*\) */g, "").normalize('NFD').replace(/[\u0300-\u036f]/g, "");
	out = out.replace(/^\u03c4\u03bf\u0020/g,"");
	if(out.indexOf(",") !== -1) out = out.substring(0, out.indexOf(","));
	if(out.indexOf(" +") !== -1) out = out.substring(0, out.indexOf(" +"));
	if(out.indexOf(" bijwoord") !== -1) out = out.substring(0, out.indexOf(" bijwoord"));
	if(out.indexOf(" bijvoeglijk naamwoord") !== -1) out = out.substring(0, out.indexOf(" bijvoeglijk naamwoord"));
	if(out.indexOf(" nom.") !== -1) out = out.substring(0, out.indexOf(" nom."));
	if(out.indexOf(" gen.") !== -1) out = out.substring(0, out.indexOf(" gen."));
	if(out.indexOf(" dat.") !== -1) out = out.substring(0, out.indexOf(" dat."));
	if(out.indexOf(" acc.") !== -1) out = out.substring(0, out.indexOf(" acc."));
	out = out.replace(/\"/g,"");
	if(/- .*-$/g.test(out)) {
		out = out.substring(out.indexOf("- ") + 2,out.length - 1);
		out = out.substring(0,out.indexOf(" "));
	}
	if(out.length > 2) out = out.replace(/^\u03b5/,"");
	return out;
}

window.onload = function () {
    var ImageMap = function (map, img) {
            var n,
                areas = map.getElementsByTagName('area'),
                len = areas.length,
                coords = [],
                previousWidth = 1852;
            for (n = 0; n < len; n++) {
                coords[n] = areas[n].coords.split(',');
            }
            this.resize = function () {
                var n, m, clen,
                    x = img.offsetWidth / previousWidth;
                for (n = 0; n < len; n++) {
                    clen = coords[n].length;
                    for (m = 0; m < clen; m++) {
                        coords[n][m] *= x;
                    }
                    areas[n].coords = coords[n].join(',');
                }
                previousWidth = img.offsetWidth;
                return true;
            };
            window.onresize = this.resize;
        },
        imageMap = new ImageMap(document.getElementById('keyboard'), document.getElementById('keys'));
    imageMap.resize();
    return;
}